import React from 'react';
import Histogram from 'react-chart-histogram';

function GraphLine() {      

    const labels = ['2017', '2018'];
    const data = [100, 50, 600];
    const options = { fillColor: '#000000', strokeColor: '#0000FF' };
    return (
    <div >
      <Histogram
          xLabels={labels}
          yValues={data}
          options={options}
      />
    </div>
  );

}
    export default GraphLine
